import React from 'react';
import './input-panel.css';


const InputPanel = () => {

    const inputPanel = 'Write what you want ?';
    return(
    <div className = 'main'>
        <form className = 'input-panel'  action="index.html" method="post">
              <input type ="text" placeholder = {inputPanel} className = 'input-text'/>
              <button type = 'submit' className = 'btn btn-outline-light'><strong>ADD NEW</strong></button>
        </form>
      </div>
    )
};

export default InputPanel;
